import Headingimg from "../images/Head.jpg"
import "./Home.css"
import Axios from "axios"
function Home() {
const  [refugeelist , setrefugeelist] = useState([]);
useEffect(()=>{
  Axios.get("http://localhost:3001/refugees")
  .then((respons)=>{
    setrefugeelist(respons.data)
  })
},[])
console.log(refugeelist);



  return (
    <div>
      <div className='Headimg'> 
          <h1>Refugees Database Project</h1>
          <img className='headingpic' src={Headingimg} alt="" />
      </div>

      <div className='cards'>
      <Refugeecard/>
      </div>
     


      {/* form */}
      <Refugeeform/>
    </div>

  )
}

export default Home
